import React, { useEffect, useState } from "react";
import s from './Disciplina2.module.css'

const Disciplina2 = () => {

    const [data2, setData2] = useState('')
    

    useEffect(() => {
        getDisc()
    }, []);

    let getDisc = async () => {
        let response = await fetch('https://def6dcc9-b637-4e72-975e-989d3170335e.mock.pstmn.io/getDisciplines/data/2018')
        let data2 = await response.json()
        console.log('DATA2', data2)
        setData2(data2)
    }

    return (

        <div className={s.main}>
            <main class="col-md-9 ms-sm-auto col-lg-10 px-md-4">

                <div className={s.main}>

                    <div class="d-flex justify-content-between flex-wrap flex-md-nowrap align-items-center pt-3 pb-2 mb-3 border-bottom">
                        <h1>Свод по дисциплинам</h1>
                    </div>

                    
                    <div div class="d-flex justify-content-between flex-wrap flex-md-nowrap align-items-center pt-3 pb-2 mb-3 border-bottom">
                        <h3>Оценки дисциплин</h3>
                    </div>
                    <div className="app">
                        <div className="row">
                            <div className="mixed-chart">
                                <div className={s.main__elements}>
                                    <table>
                                    <tr border="1" height="40" width="60"><th>Дисциплина</th><th>q1</th><th>q2</th><th>q3</th><th>q4</th><th>q5</th><th>q6</th><th>q7</th><th>Кол-во учащихся по дисциплине</th><th>Кол-во преподавателей</th></tr>
                                        {data2.map(customer => (
                                            <div key={customer.name}>
                                                <tr border="1" height="40" width="60"><th>{customer.name}</th><th>{customer.q[0]}</th><th>{customer.q[1]}</th><th>{customer.q[2]}</th><th>{customer.q[3]}</th><th>{customer.q[4]}</th><th>{customer.q[5]}</th><th>{customer.q[6]}</th><th>{customer.countOfStudents}</th><th>{customer.countOfTeachers}</th></tr>
                                            </div>
                                        ))}
                                    </table>
                                </div>

                            </div>
                        </div>
                    </div>




                </div>
            </main >

        </div >
    );
}

export default Disciplina2;
